import { Link } from "react-router-dom";
import "./Head.css"

const Header=()=>{
    return(
        <>
      <MetaData title="SSTC EXAM PORTAL" />
      <div className="navbar">
        <div className="clg_logo">
          <h2>SSTC</h2>
        </div>
        <div className="nav_items">
          <div className="nav_buttons">
         <Link to="http://182.71.130.11/edrpsstc/"><button type="button" class="nav_btn1">EDRP</button></Link>
         <Link to="/login"><button type="button" class="nav_btn2">LOGIN</button></Link>
         </div>


        </div>

      </div>
      {/* <div className="banner">
     <h1>Welcome to Shri Shankaracharya Vidyalaya Technical Campus</h1>
     <a href="#container">
            </a> */} 
          {/* </div> */}

        </>
    )
}

export default Header;
